Unveiled. The next chapter in our digital series for Libre Flowers & Flames: a project which celebrates the unique voices of those who burn to bloom. 
 
Chapter N°2 stars the multi-talented Precious Lee. Known for her strong spirit, breathtaking beauty and authentic approach to everything she does, Precious captures the essence of being a Libre woman. 
 
“I’ve never subscribed to societal conventions, which has given me freedom. Freedom is knowing you can create your own path, on your own terms, and achieve whatever you work hard towards. I am so proud to be part of this project and continue inspiring young women to show up 100% as themselves, proudly.” – Precious Lee 
 
